import * as React from 'react';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import TextField from '@mui/material/TextField';
import MenuItem from '@mui/material/MenuItem';


export default function outPut() {
    const AllTimeFile: string[] = ["a","b","c"];
    const AllMovieFile: string[] = ["a",",b","c"];
    const [Files, setFiles] = React.useState({
        Times: AllMovieFile,
        Movies: AllMovieFile
    });

    let timeArray: number[] = [];
    let flagArray: boolean[] = [];
    const [filenameState,setFilename] = React.useState({
        filename: "",
        setName: false
    })

    return (
        <Box>
            <Box
                component="form"
                sx={{
                    '& .MuiTextField-root': { m: 1, width: '25ch' },
                }}
                noValidate
                autoComplete="off"
            >
                <div>
                    <TextField
                        id="outlined-select-currency"
                        select
                        label="your MovieFiles"
                        value={Files.Times}
                        helperText=""
                    >
                        {Files.Times.map((option : any) => (
                            <MenuItem key={option.value} value={option.value}>
                            {option.label}
                            </MenuItem>
                        ))}
                    </TextField>
                    <TextField
                        id="outlined-select-currency"
                        select
                        label="your TimeFiles"
                        value={Files.Movies}
                        helperText=""
                    >
                        {Files.Movies.map((option : any) => (
                            <MenuItem key={option.value} value={option.value}>
                            {option.label}
                            </MenuItem>
                        ))}
                    </TextField>
                </div>
            </Box>
            <Stack direction="row" spacing={2}>
                <Button 
                    variant="contained"
                >
                    スタート
                </Button>
            </Stack>
        </Box>
    );
}
